            let snapshotsStart = i*snapshotChunkSize;
            let snapshotsEnd = (i+1)*snapshotChunkSize;
            sendRecordingData(i*chunkDuration, eventsStart, eventsEnd, snapshotsStart, snapshotsEnd);
